import { Routes, Route } from 'react-router-dom';


import Home from './components/home/Home';

function App() {

	return (
		<div className="App">
			<div className="title">CryptoApp 1.6</div>
			<Routes>
					<Route path="/home" element={<Home/>} />
			</Routes>
		</div>
	);
}

export default App;
